<style type="text/css">
  .btn{
    width: 100px;
    height: 80px; 
    color: #fff; 
    background: linear-gradient(0deg, rgba(0,156,173, 1) 0%, rgba(0,194,161, 1) 100%);
    font-family: 'Lato', sans-serif;
    font-weight: 500;
    font-size:20px;
    border-radius: 10px;
    box-shadow: inset 2px 2px 2px 0px rgba(255, 255, 255, .5),
    7px 7px 20px 0px rgba(0, 0, 0, .1),
    4px 4px 5px 0px rgba(0, 0, 0, .1);
    transition: all 0.3s ease;
    cursor: pointer;
    border: none;
    position: relative;
    line-height: 80px;
    padding: 0;
 }
 .btn span{
     position: relative;
     display: block;
     width: 100%;
     height: 100%;
     font-size: 48px;
     font-family:
 }
 .btn::before,.btn::after{
     position:absolute;
     content: '';
     top: 0;
     right: 0;
     background: rgba(2, 126, 251, 1); 
     transition: all 0.3s ease;
 }
 .btn::before{
     width: 0;
     height: 2px;
 }
 .btn::after{
     height: 0;
     width: 2px;
 }
 .btn:hover{
     background: transparent;
     color: rgba(2, 126, 251, 1);
 }
 
 .btn:hover::before{
     width: 100%;
 }
 .btn:hover::after{
     height: 100%;
 }
 .btn span:hover::before{
     width: 100%;
 }
 .btn span:hover::after{
     height: 100%;
 }
</style>
<body>
    <div id="box" style="width: 1920px;height:960px;background-image: linear-gradient(to right bottom,#006980,#00898C);"> 
      <div id="static" style="width: 330px;height: 960px;float:left;">
        <!--时间-->
        <div class="box4" style="width: 300px;height: 450px;margin-left: 15px;margin-top:20px;background-color:rgba(0,53,82,0.65);"></div>
        <!--震源深度-->
        <div class="box2" style="width: 300px;height: 450px;margin-left: 15px;margin-top:20px;background-color:rgba(0,53,82,0.65);"></div>
      </div>
      
      <div id="main_main" align="center" style="width: 1080px;height:920px;margin-top:20px;float:left;background-color:rgba(0,53,82,0.65);"> 
        <!--地图-->
        <div id="main" style="width: 1080px;height:800px;float:left"></div>
        <!-- 更新地图地震点按钮  -->
        <input type="button" value="更新地震点" class="btn" onclick="updatemap()">
        <!-- 清楚地图所有地震点按钮 -->
        <input type="button" value="清除地震点" class="btn" onclick="clearmap()">
        <!-- 网页使用说明 -->
        <input type="button" value="使用说明" class="btn" onclick="showMsg()">
        <script>
          function showMsg(){
            alert("本系统为世界地震数据可视化，收录了从1973年到2023年里mb震级大于4.5级的各个地震。\n整个系统分为六个部分，左边两个图是地震发生时间柱状图和地震深度频率图，为静态图，展示了1973年到2023年的地震发生时间分布和震源深度分布；\n中间是世界地图，更新地震点可以根据右边折线图选中的时间范围将所选时间内所有的地震点显示在世界地图上，鼠标放到每个点上会显示该处地震的详细信息；\n右边三个图分别为每年地震数量折线图、震级分布饼状图、地震频次排名柱状图，这三个图为动态展示，根据折线图的X轴所选中的时间范围动态展示相关时间内的地震信息，其中每年地震数量图是每一年的地震数量统计，震级分布是各个震级的地震统计，每个数字代表它本身和它下面0.5级地震的数量，如5代表的是4.5至5.0，地震频次排名图显示的是对应年份内地震发生次数前十的地区。");
        }
        </script>
      </div>

          function clearmap(){
            var StartTime = 1;
            var EndTime = 0;
          
            var data_deal = [];
            for(var year=StartTime;year<=EndTime;year++)
            {
              for(var frequency=0;frequency<data_earthquake[0][year].length;frequency++)
              {
                var longitude = data_earthquake[0][year][frequency].longitude;
                var latitude = data_earthquake[0][year][frequency].latitude;
                var every_data = "{name:'"+year+"',value:["+longitude+","+latitude+"],itemStyle:{color:'rgba(255,0,0,0.2)'}}"
                data_deal.push(every_data);
              }
            }
            var data_final = data_deal.join(",");
            data_final = '['+data_final+']';
            var json=eval('('+data_final+')');

            var option = {
                title: {
                    text: name_title,
                    x: 'center',
                    textStyle: {
                      fontSize: 26,
                      color: '#FFFFFF',
                },                  
                },
                tooltip: ,         
                geo: {
                    show: true,
                    map: mapName,
                    label: {
                        normal: {
                            show: false,
                            fontSize:12,
                        },
                        emphasis: {
                            show: false,
                        }
                    },
                    roam: true,
                    itemStyle: {
                        normal: {
                            areaColor: '#F6F6F6',
                            borderColor: '#666666',
                        },
                        emphasis: {
                            areaColor: '#0099CC',
                        }

                },
                series: [
                {
                        type:'effectScatter',

                        effectType:'ripple',

                            period:10,

                            brushType:'stroke',
                        },
                        data:json
                    }
                ]
            };

          myChart.setOption(option);
